网络请求（旧）
export function nativeRequest(
    {
        url,
        param,
        method,
        header = {
            'X-Requested-With': 'XMLHttpRequest',
            Accept: '*/*',
            'Content-Type': 'application/json; charset=utf-8'
        },
        network_id,
        ...other
    },
    callback
) {
    url = url.replace(/^http:\/\/|^HTTP:\/\/|^\/\//, function() {
        return location.protocol + '//';
    });
    let params = {
        url,
        param,
        method,
        header,
        network_id,
        ...other
    };
    let paramsToNative = {
        host: 'handlejs',
        path: 'nativeRequest',
        query: params
    };
    _nativeBridge(paramsToNative, callback);
}

